import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import s from './Header.module.css';
import userPhoto from '../../assets/images/user.png';

const Header = (props) => {
    let [myProfile, setMyProfile] = useState(props.myProfile)
    useEffect(setMyProfile(props.myProfile), [props.myProfils])
    return (
        <header className={s.header}>
            <img src='https://fv2-5.failiem.lv/thumb_show.php?i=26pk8r8nq&view'></img>
            <div className={s.loginBlock}>
                {props.isAuth ? (<div>{props.myProfile.photos.small != null ? props.myProfile.photos.small : userPhoto} - <button onClick={props.logout}>Log out</button></div>) : <NavLink to={'/login'}>Login</NavLink>}
            </div>
        </header>
    )  
};

export default Header;
